import React from 'react';

const Cards = {
    borderRadius: "24px",
    border: "solid",
    borderColor: "white",
    padding: "12px",
    backgroundColor: "black",
    color: "white",
}

const CardStyle = {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
}

const imageStyle = {
    height: "50vh",
    borderRadius: "24px",
    margin: "8px",
}

export default function ProjectCard({ images, title }) {
    return (
        <div style={Cards}>
            <code>{title}</code>
            <div className={CardStyle}>
                {images.map((value) => <img style={imageStyle} src={value} alt="Photos of projects" />)}
            </div>
        </div>
    )
}
